//
//【招式名称】：一分为二
//【施展之人】：扫地僧，乃武林高手
//【核心思想】：以最小的代价将庞大势力分割为更小的易于控制的力量
//
function quickSort(arr) {
  //
  //【招式要旨】：若是敌人力量微弱，则不必动用大招；
  //       若是敌军数量不多，便各自为战，无须联合。
  if (arr.length <= 1) return arr;

  //
  //【关键所在】：选定一核心之人作为本次决战的关键人物——即数组首位元素
  const pivot = arr[0];

  //
  //【左右分明】：划分敌我阵营，使强者、弱者各得其所。
  const left = [];
  const right = [];

  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      //
      //【轻巧躲避】：敌小如蚊，不必挥剑；以袖掩面，足以致胜。
      left.push(arr[i]);
    } else {
      //
      //【雷霆一击】：敌强如虎，无需顾虑；拳打脚踢，斩钉截铁。
      right.push(arr[i]);
    }
  }

  //
  //【收拢余烬】：将已降伏的敌人尽数调教，使成为己用；
  return [...quickSort(left), pivot, ...quickSort(right)];
}
